1. The report of the Secretary-General on the situation in Cambodia (S/2009/186);
2. The report of the Secretary-General on the situation in the Democratic Republic of the Congo (S/2009/187);
3. The report of the Secretary-General on the situation in Timor-Leste (S/2009/188);
4. The report of the Secretary-General on the situation in the Sudan (S/2009/189);
